import CloseIcon from "../../../assets/icons/close.png"

const BindingModal = ({ handleShowBindModal, }) => {
  return (
    <div className="modal">
      <div className="close-icon">
        <img src={CloseIcon} alt="" />
      </div>
      <div className="modal-wrapper">
        <p>BIDDING</p>
      </div>
    </div>
  );
};

export default BindingModal;
